import React from 'react';
import './App.css';

function App() {
  return (
    <div className='App'>
      <header className='App-header'>
        <h6>How To Demo.Me</h6>
      </header>
      <div className='App-Body'>
        <img src='./Assets/tsunami643.jpg' alt='tsunami' />
      </div>
    </div>
  );
}

export default App;
